import { makeAutoObservable } from "mobx";

export default class NoteStore {
    constructor() {
        this._types = [
            {id: 1, cat: 'todo'},
            {id: 2, cat: 'buy'}
        ],
        this._notes = [
            {
                id: 1,
                title: 'a'
            },
            {
                id: 2,
                title: 'b'
            },
            {
                id: 3,
                title: 'c'
            }
        ],
        makeAutoObservable(this)
    }
}
